function ganti(){
	let random_nama = nama[Math.floor(Math.random()*nama.length)];
	let random_kata	= kata[Math.floor(Math.random()*kata.length)].toLowerCase();
	let tanggal		= $("#tanggal").val();
	let pukul		= generateRandom(8,16) + "." + generateRandom(0,59)
	let desa_val	= $("#desa").val();
	let desa_rand	= desa[desa_val][Math.floor(Math.random()*desa[desa_val].length)]
	let dusun		= desa_rand[0];
	let rw 			= desa_rand[1];
	let rt 			= desa_rand[2];
	let d 			= new Date(tanggal);
	let hari 		= seminggu[d.getDay()];
	let uraian		= "Pada hari " + hari + " (" + d.toLocaleDateString("id") + ") Pukul " + pukul + " WIB saya bertemu dengan Bpk. " + toProperCase(random_nama) + " di Ds. " + toProperCase(desa_val) + " Kec. Plumpang.\n\nBpk. " + toProperCase(random_nama) + " " + random_kata;

	// set value
	$('#nama').val(random_nama);
	$('#hari').val(hari);
	$('#uraian').val(uraian);
	$('#pukul').val(pukul);
	$('#dusun').val(dusun);
	$('#rt').val(rt);
	$('#rw').val(rw);
}

function generateRandom(min, max) {

    // find diff
    let difference = max - min;

    // generate random number 
    let rand = Math.random();

    // multiply with difference 
    rand = Math.floor( rand * difference);

    // add with min value 
    rand = rand + min;

    return rand > 9 ? "" + rand: "0" + rand;
}

function toProperCase(val) {
	return val.replace(/\w\S*/g, function(txt){return txt.charAt(0).toUpperCase() + txt.substr(1).toLowerCase();});
}

